import Login from './login';

function App() {
  return (
    <Router>
      <Routes>
      <Route path="/login" component={Login} />
          <Route path="/clientViewer" component={ClientViewer} />
          <Redirect from="/" to="/login" />
      </Routes>
    </Router>
  );
}

export default App;
